import React from 'react'
import './Todo.css';
const Todo = () => {
  return (
    <div className='todo'>
        <div className='todo_contai/ner'>
            <div className='todo_container-top'>
                <input className='todo_container-top-input' type="text" placeholder='Enter a task' />
                <button className='todo_container-top-add'>Add</button>
            </div>
        </div>
    </div>
  )
}

export default Todo
